import React, { Component } from 'react';
import { Label, FormText, Button, Container, Form, FormGroup, Input} from "reactstrap";
import ReactTable from 'react-table'
import "react-table/react-table.css"
import { Row, Col } from 'reactstrap';

class Rank extends Component {
  constructor(props) {
    super(props);
    this.state = {
      folder_path: "",
      ps_content: "",
      candidate_data: []
    };
    this.handleChange = this.handleChange.bind(this);
  }


	handleChange(event) {
		this.myspan.textContent = event.target.files.length + " files selected"
		for (var i = 0; i < event.target.files.length; i++) {
			const file = event.target.files[i];

	        if (!file) {
	            return;
	        }

	        const reader = new FileReader();
	        // Asynchronous function
	        reader.onloadend = () => {
	        	const content = reader.result;
	        	// console.log(content)
	        	this.setState({ps_content: content});


				// Upload formdata to api
		        const url = 'http://personality-insights.shahabqamar.com/api/';
		        const form = new FormData();
		        form.append('raw-text-content', content);
		        // console.log(form)
		        const self = this;
		        fetch(url, {
		            method: 'POST',
		            body: form
		        })
		        .then(function(response) {
			        return response.json();
			        })
		        .then(
			        function(data) {
		        	  // add more content here
			          console.log(data);
			          let temp_data = {
			          		name: file.name,
						    openness: data["personality"][0]["percentile"],
						    conscientiousness: data["personality"][1]["percentile"],
						    extraversion: data["personality"][2]["percentile"],
						    agreeableness: data["personality"][3]["percentile"],
						    neuroticism: data["personality"][4]["percentile"]
						};

		          	  console.log(temp_data);

		          	  // append to candidate_data

	          	  		var newArr = self.state.candidate_data;
	          	  		newArr.push(temp_data)
		          	  	self.setState({candidate_data: newArr})
		          	  	console.log(self.state.candidate_data)

			        }
	      		)
	        }
	        reader.readAsText(file);
		}
	}

	render() {
		return (
		  <div>
		  	<Container className="choose-file">
				<Form onSubmit={this.handleSubmit}>
				    <FormGroup>
						<h1 page-heading text-center>Please choose folder which contains all the Personal Statements</h1>
						<Container>
					        <Row>
					          <Col xs="3"></Col>
					          <Col xs="auto">
								<Input onChange={this.handleChange} type="file" accept=".txt" id="file-1" className="inputfile inputfile-1" data-multiple-caption="{count} files selected" multiple />
								<Label for="file-1">
									<svg xmlns="http://www.w3.org/2000/svg" width="20" height="17" viewBox="0 0 20 17">
										<path d="M10 0l-5.2 4.9h3.3v5.1h3.8v-5.1h3.3l-5.2-4.9zm9.3 11.5l-3.2-2.1h-2l3.4 2.6h-3.5c-.1 0-.2.1-.2.1l-.8 2.3h-6l-.8-2.2c-.1-.1-.1-.2-.2-.2h-3.6l3.4-2.6h-2l-3.2 2.1c-.4.3-.7 1-.6 1.5l.6 3.1c.1.5.7.9 1.2.9h16.3c.6 0 1.1-.4 1.3-.9l.6-3.1c.1-.5-.2-1.2-.7-1.5z"/>
									</svg> 
									<span ref={(span) => this.myspan = span}>Choose a file&hellip;</span>
								</Label>
					          </Col>
					          <Col xs="3"></Col>
					        </Row>

						</Container>
				    </FormGroup>

				    <Button
				      type="submit"
				      size="lg">
				      Analyse
				    </Button>
				</Form>
			</Container>
			<Container className="rank-table">
		        <ReactTable
					columns={[
					{
					  Header: "Name",
					  accessor: "name"
					},
					{
					  Header: "Openness",
					  accessor: "openness",
					},
					{
					  Header: "Conscientiousness",
					  accessor: "conscientiousness",
					},
					{
					  Header: "Extraversion",
					  accessor: "extraversion"
					},
					{
					  Header: "Agreeableness",
					  accessor: "agreeableness"
					},
					{
					  Header: "Emotional Range",
					  accessor: "neuroticism"
					}
					]}
					data={this.state.candidate_data}
					defaultPageSize={10}
					className="-striped -highlight"
				/>
			</Container>

		  </div>
		);
	}
}

export default Rank;
